      // </div>
      <div key={i} className="tile">
        <div className="header">{name}</div>
        <div className="value">{impact}</div>
      </div>
    //   Container({name, impact, p_impact, n_impact, overall})
    );
  }

  return <div className="tile-container">{tiles}</div>;
}

